      content: >
        [head=3]Как стать цветным гостом:[/head]

        > 1. Кликаете по себе ПКМ

        > 2. В меню выбираете "View Variables"

        > 3. В открывшейся менюшке выбираете "Компоненты сервера". (ИМЕННО СЕРВЕРА, КОМПОНЕНТЫ КЛИЕНТА - ГОВНО)

        > 4.Ищете в списке GhostComponent

        > 5. Там ищете графу "color"

        > 6. Ищете в интернете палитру Хекс кодов

        > 7. В ней выбираете интересующий Вас цвет

        > 8. Копируете его хекс код в графу из пункта 5

        > 9. Нажимаете Enter

        > 10. Радуетесь
